import React from 'react';
import Link from 'next/link';
import * as types from '../../redux/blog/blogTypes';

const Post = ({ post }: types.PostType): JSX.Element => {
    console.log('post', post);
    return (
        <>
            <Link href="/posts/[id]" as={`/posts/${post.id}`}>
                <a>{post.title}</a>
            </Link>
        </>
    );
};

export default Post;
